<div class="wpb_wrapper">
<h2 style="text-align: center;"><strong>O NAS</strong></h2>
<p style="text-align: center;">Gra w kregle (bowling) to latwy i nie wymagajacy specjalnych umiejetnosci sport. Ogolnie mowiac gra polega na toczeniu kuli po torze i stracaniu kregli. Latwosc i prostota to powod, dla ktorego od wielu lat bowling jest tak popularny wsrod milionow ludzi. W kregle moze grac kazdy, niezaleznie od wzrostu, wagi czy wieku. Bowling jest dla jednych sportem, dla drugich rekreacja, dla innych wspolna zabawa i rozrywka.</p>
<h2 style="text-align: center;"><strong>O KREGIELNI</strong></h2>
<p style="text-align: center;">KRAEGIELNIA to miejsce, w ktorym mozna spotkac sie z cala rodzina, zabrac ze soba dzieci, ktore beda sie cieszyly ze zbicia chociaz jednego kregla. W Bowling Planeta spotkasz sie z przyjaciolmi i zagrasz w kregle, ktore sa jednoczesnie sportem i swietna rozrywka dla wszystkich.Naszym Gosciom udostepniamy cztery tory do gry w kregle. Dwa z nich wyposazono w bandy ochronne dla dzieci, ktore ulatwiaja gre poczatkujacym maluchom. By pomoc najmlodszym w grze, do dyspozycji posiadamy takze SuperSmoka, ktory pomoze dzieciakom trafic kula w cel. W naszej ofercie posiadamy takze 4 stoly bilardowe, dartsa oraz pilkarzyki. Zapraszamy cale rodziny do wysmienitej zabawy w naszej kregielni.</p>

